import ListItem from "../ListItem/ListItem";
import useApiRequest from "../hooks/useApiRequest"

const List = ({itemURL}) => {

    const { pokemonDetail, isLoading } = useApiRequest(itemURL)

    return (
        <div className="list">
            <ListItem itemName={pokemonDetail.name} itemIMG={pokemonDetail.img}/>
        </div>
    );
}

export default List;
